/**
 * 
 */
import "../../styles/Components/Header.css"
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import { Swiper, SwiperSlide } from "swiper/react"
import { Pagination, Navigation } from "swiper"

let slidesData = [
    {img: "webket.jpg", title: "The World Of 'ket'", owner: "webket", time: "10 mins"},
    {img: "smarix.jpg", title: "What a great matrix!", owner: "smarix", time: "13 mins"},
    {img: "supercoder.jpg", title: "Generate the future", owner: "supercoder", time: "15 mins"},
    {img: "instant.jpg", title: "We're here for you", owner: "instant", time: "27 mins"},
    {img: "dipdux.jpg", title: "Try it now!", owner: "dipdux", time: "32 mins"}
]

function SectionTop() {
    return (
        <div className="section-top">
            <h3>New Uploads</h3>
            <div className="swiper-navigation">
                <button><ion-icon name="chevron-back"></ion-icon></button>
                <button><ion-icon name="chevron-forward"></ion-icon></button>
            </div>
        </div>
    )
}

function Slide( data ) {
    return (
        <SwiperSlide>
            <img src={data.img} alt="" />
            <h4>{data.title}</h4>
            <p>By {data.owner} | {data.time} ago</p>
            <button><ion-icon name="close"></ion-icon></button>
            <button>
                <ion-icon name="play"></ion-icon>
                <span>Watch Now</span>
            </button>
        </SwiperSlide>
    )
}

function CarouselSection() {
    let slides = slidesData.map(slide => {
        <SwiperSlide>
            <Slide key={slide.owner} slide/>
        </SwiperSlide>
    })
    return (
        <Swiper
            modules={[Navigation, Pagination]}
            spaceBetween={50}
            slidesPerView={1}
            // navigation
            loop={true}
            pagination={{ clickable: true }}
            // onSwiper={(swiper) => console.log(swiper)}
            // onSlideChange={() => console.log('slide change')}
        >
            {slides}
        </Swiper>
    )
}

export default function Header() {
    return (
        <div className="header-section">
            <SectionTop />
            <CarouselSection />
        </div>
    )
}
